import React from "react";
import Input from "../Input/Input";
const LoginForm = () => {
  const handleFormChange = (value, type) => {
    console.log("test kimo value", value, type);
  };
  return (
    <div className="flex flex-col border-2 border-blue rounded-xl items-center justify-center w-3/4 pt-8 pb-8  shadow-md  shadow-blue gap-8 bg-cyberDarkBlue">
      <Input
        type="text"
        handleChange={(value) => handleFormChange(value, "email")}
        placeholder="E-mail"
      />

      <Input
        type="password"
        handleChange={(value) => handleFormChange(value, "password")}
      />
    </div>
  );
};

export default LoginForm;
